INSERT INTO `ts_songtitle` VALUES (1,'Tim McGraw','Taylor Swift',''),(2,'Picture to Burn','Taylor Swift',''),(3,'Teardrops On My Guitar','Taylor Swift',''),(4,'A Place In This World','Taylor Swift',''),(5,'Cold as You','Taylor Swift',''),(6,'The Outside','Taylor Swift',''),(7,'Tied Together with a Smile','Taylor Swift',''),(8,'Stay Beautiful','Taylor Swift',''),(9,'Should\'ve Said No','Taylor Swift',''),(10,'Mary\'s Song (Oh My My My)','Taylor Swift',''),(11,'Our Song','Taylor Swift',''),(12,'I\'m Only Me When I\'m With You','Beautiful Eyes',''),(13,'Invisible','Taylor Swift',''),(14,'A Perfectly Good Heart','Taylor Swift',''),(15,'Beautiful Eyes','Beautiful Eyes',''),(16,'I Heart ?','Beautiful Eyes',''),(17,'Fearless (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(18,'Fifteen (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(19,'Love Story (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(20,'Hey Stephen (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(21,'White Horse (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(22,'You Belong With Me (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(23,'Breathe (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(24,'Tell Me Why (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(25,'You\'re Not Sorry (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(26,'The Way I Loved You (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(27,'Forever & Always (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(28,'The Best Day (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(29,'Change (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(30,'Jump Then Fall (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(31,'Untouchable (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(32,'Come In With The Rain (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(33,'Superstar (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(34,'The Other Side of the Door (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(35,'Today Was a Fairytale (Taylor\'s Version)','Fearless (Taylor\'s Version)',''),(36,'You All Over Me (Taylor\'s Version) [From the Vault]','Fearless (Taylor\'s Version)',''),(37,'Mr. Perfectly Fine (Taylor\'s Version) [From the Vault]','Fearless (Taylor\'s Version)',''),(38,'We Were Happy (Taylor\'s Version) [From the Vault]','Fearless (Taylor\'s Version)',''),(39,'That\'s When (Taylor\'s Version) [From the Vault]','Fearless (Taylor\'s Version)',''),(40,'Don\'t You (Taylor\'s Version) [From the Vault]','Fearless (Taylor\'s Version)',''),(41,'Bye Bye Baby (Taylor\'s Version) [From the Vault]','Fearless (Taylor\'s Version)',''),(42,'Mine (Taylor\'s Version)','Speak Now (Taylor\'s Version)','Ah-ah, ah-ah\nAh-ah, ah-ah\n\n[Verse 1]\nYou were in college working part-time, waiting tables\nLeft a small town, never looked back\nI was a flight risk with a fear of falling\nWondering why we bother with love if it never lasts\n\n[Pre-Chorus]\nI say, \"Can you believe it?\"\nAs we\'re lying on the couch\nThe moment I could see it\nYes, yes, I can see it now\n\n[Chorus]\nDo you remember, we were sitting there by the water?\nYou put your arm around me for the first time\nYou made a rebel of a careless man\'s careful daughter\nYou are the best thing that\'s ever been mine\n\n[Verse 2]\nFlash forward and we\'re taking on the world together\nAnd there\'s a drawer of my things at your place\nYou learn my secrets and you figure out why I\'m guarded\nYou say we\'ll never make my parents\' mistakes\n\n[Pre-Chorus]\nBut we got bills to pay\nWe got nothing figured out\nWhen it was hard to take\nYes, yes, this is what I thought about\n\n[Chorus]\nDo you remember, we were sitting there by the water?\nYou put your arm around me for the first time\nYou made a rebel of a careless man\'s careful daughter\nYou are the best thing that\'s ever been mine\nDo you remember all the city lights on the water?\nYou saw me start to believe for the first time\nYou made a rebel of a careless man\'s careful daughter\nYou are the best thing that\'s ever been mine\n\n[Post-Chorus]\nOh-oh, oh\n\n[Bridge]\nAnd I remember that fight, 2:30 AM\nAs everything was slipping right out of our hands\nI ran out crying and you followed me out into the street\nBraced myself for the goodbye\n\'Cause it\'s all I\'ve ever known\nThen you took me by surprise\nYou said, \"I\'ll never leave you alone\" (Oh)\n[Chorus]\nYou said, \"I remember how we felt sitting by the water\nAnd every time I look at you, it\'s like the first time\nI fell in love with a careless man\'s careful daughter\nShe is the best thing that\'s ever been mine\"\n\n[Post-Chorus]\nHold on, make it last\nHold on, never turn back\n(Hold on) You made a rebel of a careless man\'s careful daughter\n(Hold on) You are the best thing that\'s ever been mine\n\n[Outro]\nDo you believe it? (Yeah, yeah, yeah)\nWe\'re gonna make it now (Yeah, yeah, yeah)\nAnd I can see it (Yeah, yeah)\nI can see it now'),(43,'Sparks Fly (Taylor\'s Version)','Speak Now (Taylor\'s Version)','The way you move is like a full on rainstorm\nAnd I\'m a house of cards\nYou\'re the kind of reckless that should send me runnin\'\nBut I kinda know that I won\'t get far\nAnd you stood there in front of me, just close enough to touch\nClose enough to hope you couldn\'t see what I was thinkin\' of\n\n[Chorus]\nDrop everything now, meet me in the pouring rain\nKiss me on the sidewalk, take away the pain\n\'Cause I see sparks fly whenever you smile\nGet me with those green eyes, baby, as the lights go down\nGive me something that\'ll haunt me when you\'re not around\n\'Cause I see sparks fly whenever you smile\n\n[Verse 2]\nMy mind forgets to remind me you\'re a bad idea\nYou touch me once and it\'s really somethin\'\nYou find I\'m even better than you imagined I would be\nI\'m on my guard for the rest of the world\nBut with you, I know it\'s no good\nAnd I could wait patiently, but I really wish you wou