tment','By all accounts, she almost drowned\nWhen she was six in frigid water\nAnd I can confirm she made\nA curious child, ever reviled\nBy everyone except her own father\nWith a quite bewitching face\nSplendidly selfish, charmingly helpless\nExcellent fun \'til you get to know her\nThen she runs like it\'s a race\nBehind her back, her best mates laughed\nAnd they nicknamed her \"The Bolter\"\n\n[Chorus]\nStarted with a kiss\n\"Oh, we must stop meeting like this\"\nBut it always ends up with a town car speeding\nOut the drive one evening\nEnded with the slam of a door\nThen he\'ll call her a whore\nWish he wouldn\'t be sore\nBut as she was leaving\nIt felt like breathing\n\n[Post-Chorus]\nAll her fuckin\' lives\nFlashed before her eyes\nIt feels like the time\nShe fell through the ice\nThen came out alive\n\n[Verse 2]\nHe was a cad, wanted her bad\nJust like any good trophy hunter\nAnd she liked the way it tastes\nTaming a bear, making him care\nWatching him jump then pulling him under\nAnd at first blush, this is fate\nWhen it\'s all roses, portrait poses\nCentral Park Lake in tiny rowboats\nWhat a charming Saturday\nThat\'s when she sees the littlest leaks\nDown in the floorboards\nAnd she just knows she must bolt\n\n[Chorus]\nStarted with a kiss\n\"Oh, we must stop meeting like this\"\nBut it always ends up with a town car speeding\nOut the drive one evening\nEnded with the slam of a door\nThen he\'ll call her a whore\nWish he wouldn\'t be sore\nBut as she was leaving\nIt felt like breathing\n\n[Post-Chorus]\nAll her fuckin\' lives\nFlashed before her eyes (Ah-ah-ah)\nIt feels like the time\nShe fell through the ice\nThen came out alive\n[Bridge]\nShe\'s been many places with\nMen of many faces\nFirst, they\'re off to the races\nAnd she\'s laughing, drawin\' aces\nBut none of it is changin\'\nThat the chariot is waitin\'\nHearts are hers for the breakin\'\nThere\'s escape in escaping\n\n[Chorus]\nStarted with a kiss\n\"Oh, we must stop meeting like this\"\nBut it always ends up with a town car speeding\nOut the drive one evenin\'\nEnded with the slam of a door\nBut she\'s got the best stories\nYou can be sure\nThat as she was leaving\nIt felt like freedom\n\n[Post-Chorus]\nAll her fuckin\' lives\nFlashed before her eyes (And she realized)\nIt feels like the time\nShe fell through the ice\nThen came out alive'),(233,'Robin','The Tortured Poets Department','Long may you reign\nYou\'re an animal, you are bloodthirsty\nOut window panes talking utter nonsense\nYou have no idea\n\n[Pre-Chorus]\nStrings tied to levers\nSlowed-down clocks tethered\nAll this showmanship\nTo keep it for you in sweetness\n\n[Chorus]\nWay to go, tiger\nHigher and higher\nWilder and lighter\nFor you\n\n[Verse 2]\nLong may you roar\nAt your dinosaurs\nYou\'re a just ruler\nCovered in mud, you look ridiculous\nAnd you have no idea\n\n[Pre-Chorus]\nBuried down deep\nAnd out of your reach\nThe secret we all vowed\nTo keep it from you in sweetness\n\n[Chorus]\nWay to go, tiger\nHigher and higher\nWilder and lighter\nFor you\n\n[Bridge]\nYou got the dragonflies above your bed\nYou have a favorite spot on the swing set\nYou have no room in your dreams for regrets\n(You have no idea)\nThe time will arrive for the cruel and the mean\nYou\'ll learn to bounce back just like your trampoline\nBut now we\'ll curtail your curiosity\nIn sweetness\n\n[Chorus]\nWay to go, tiger (Way to go, tiger)\nHigher and higher (Higher and higher)\nWilder and lighter\nFor you'),(234,'The Manuscript','The Tortured Poets Department','Now and then, she rereads the manuscript\nOf the entire torrid affair\nThey compared their licenses\nHe said, \"I\'m not a donor but\nI\'d give you my heart if you needed it\"\nShe rolled her eyes and said\n\"You\'re a professional\"\nHe said, \"No, just a good samaritan\"\nHe said that if the sex was half as good as the conversation was\nSoon, they\'d be pushin\' strollers\nBut, soon, it was over\n\n[Verse 2]\nIn the age of him, she wished she was thirty